import React from "react"

const ResetButton = ({ onClick }) => {
    return (
        <i
            className="reset-button"
            onClick={onClick}
            title="Reset the Base"
        >
            <span className="reset-button">Reset the Base</span>
        </i>
    )
}

export default ResetButton
